import React from "react";
import { IntroRow, BodyRow } from "./components";
import "./App.css";

const App: React.FC = () => {
  return (
    <div className="App">
      <div className="container">
        <IntroRow />
        <BodyRow />
      </div>
    </div>
  );
};

export default App;
